import React from 'react';
import { StyleSheet, css } from 'aphrodite';
import {createlogo} from './Create Subscriber.png';
import {decommlogo} from './Decommission.png';

const styles = StyleSheet.create({
    imageicons:{
        height:'13vh',
        minHeight:'13vh',
        minWidth:'9vw',
        width: '9vw',
        justifyContent:'center',
        borderRadius:'10vh',
        padding: '2vh',
        paddingBottom:'4vh'
        },
    separator: {
        paddingTop: '10vh',
        borderTop: '0.5vh solid ',
        padding:0,
        left:0,
        marginTop: '1vh',
        opacity: 0.06
    },
    text:{
        paddingTop:'3vh',
        fontFamily: 'Muli',
        fontSize: '1vw',
        fontWeight:'bold',
        textAlignLast:'center',
        lineHeight: '0.1vh',
        letterSpacing: '0.2px',
        color: 'black',
    }
    }
)

const SaasCard = () => {
    return(
    <div>
        <div className= 'tc  cards pointer'>
            <img alt='robots' src= {createlogo} className={css(styles.imageicons)}/>
            <div className={css(styles.separator)}></div>
            <div>
                <p className={css(styles.text)}>Create Subscriber</p>
            </div>
        </div>
        <div className= 'tc  cards pointer'>
            <img alt='robots' src= {decommlogo} className={css(styles.imageicons)}/>
            <div className={css(styles.separator)}></div>
            <div>
                <p className={css(styles.text)}>Decommission</p>
            </div>
        </div>
    </div>
    )
}

export default SaasCard;
